import { useState } from "react";

function SuspenseChild() {
    const [data, setData] = useState(null);

    const handleFetch = () => {
        fetch('/api')
            .then(data => setData(data))
            .catch((error) => {
                console.log(error);
            });

    };

    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/posts/1")
            .then((res) => res.json())
            .then((data) => setData(data));
    }, []);

    return (
        <div>
            <h1>Suspense Child</h1>
            {data && <p>{data.title}</p>}
        </div>
    );
}
